export const CHANGE_VALUE = 'CHANGE_VALUE'

export const changeValue = value => async dispatch => {
  console.log(value)
  return await new Promise((resolve) => {
    setTimeout(() => {
      resolve(dispatch({ type: CHANGE_VALUE, value }))
    }, 2000)
  })
}
